import React, { Component } from "react";

import {
    NavLink,
} from "react-router-dom";
import delighters from '../common/delighters';


class Home extends React.Component {
    componentDidMount() {
        delighters.init();
    }
    render() {
        return (
                <div className="home">
                    <section className="demo" data-delighter>
                        <ul className="main-visual">
                            <li className="left">
                                <ul>
                                    <li><h1>Hello, I’m Yasuhiro.</h1></li>
                                    <li>I’m a Front End developer.</li>
                                    <li>
                                        <ul className="sns">
                                            <li><a href="https://www.linkedin.com/in/yasuhiro-katayama-118423160/" target="_blank" className="fa fa-linkedin"></a></li>
                                            <li><a href="https://github.com/yasu0406" target="_blank" className="fa fa-github"></a></li>
                                            <li><a href="https://www.facebook.com/yasuhiro.katayama2" target="_blank" className="fa fa-facebook"></a></li>
                                        </ul>
                                    </li>
                                </ul>
                            </li>
                        </ul>
                    </section>
                    <section className="work-box demo">
                        <div>
                            <NavLink to="/worksDetail"><img src="/img/img-works-01.png" alt=""/></NavLink>
                        </div>
                        <ul>
                            <li><h2><NavLink to="/worksDetail">METAL REVISION.INC</NavLink></h2></li>
                            <li>Freelance job / Website</li>
                            <li><NavLink to="/worksDetail">View →</NavLink></li>
                        </ul>
                    </section>
                </div>
        );
    }
}

export default Home;
